import { Route, Routes } from 'react-router-dom';
import './App.css';
import Login from './Pages/Login';
import SignUp from './Pages/SignUp';

function App() {
  return (
    <div className="App">
      <Routes> 
            <Route path="/login"  component={Login } /> 
            <Route path="/signup" component={SignUp } /> 
       </Routes> 
      <SignUp/>
      {/* <Login/> */}

    </div>
  );
}

export default App;
